Defendant Saul Hubbard in court with attorney .  Defendant Saul Hubbard in custody.  Deann L. Heard appeared for the State of Wisconsin.  Plea hearing proceeds.  Defendant was advised of constitutional rights and maximum penalties, and further advised that if not a United States citizen deportation is possible. Defendant sworn, examined as to plea, and entered a plea of guilty.  Court found defendant freely, voluntarily and intelligently waived all constitutional rights. Plea questionnaire waiver of rights and addendum to plea questionnaire received and filed. Parties stipulated to the criminal complaint as factual basis to sustain defendant's plea. Court found defendant guilty as charged in the Information and ordered a Judgment of Conviction be entered into the record.  The Court advised defendant that as a convicted felon not to possess any firearms/body armor.    Court further advised defendant of voting ineligibility. 

Sentencing proceeded.  Statements by the State, defense and defendant.  The Court imposed the following sentence:

Court imposed 12 months at the House of Correction, with good time; credit for 40 days.  Court STAYED said sentence and placed defendant on probation for two (2) years.  

CONDITIONS OF PROBATION:
 - Undergo a mental health evaluation and follow thru with any treatment recommended;
 - No controlled substances other than those legally prescribed for defendant by a duly licensed physician for his mental or physical needs, and for only as long as deemed medically necessary; must follow proper, prescribed dosing; DO NOT use street drugs to medicate;
 - No alcohol;
 - Urine screens; 
- AODA assessment and treatment;
 - Obtain GED;
 - Cognitive thinking intervention counseling;
 - No contact with the victim in this case, Mr. Albert H.;
 - Seek and maintain employment, to the extent possible;
 - Anger management counseling;
 - Court directs Probation Department to assist defendant in obtaining housing;
 - Pay restitution to the victim, Albert H., in the stipulated amount of $75.00 first; then pay all applicable surcharges, costs, disbursements and supervision fees.  Failure to pay would result in a civil judgment entered against defendant, which is non-dischargable in bankruptcy.  

Filed,
Notice of Right to Seek Postconviction Relief;
Pretrial Incarceration Credit form;
Ineligible Voting Notice and Acknowledgment.
